    <DetailModal id="detail-modal-container">
      <div>ss</div>
    </DetailModal>,
    detailModalElem
  );
};

export default Detail;

const DetailModal = styled.div`
  position: absolute;
  width: 100vw;
  height: 100vh;
  background-color: gray;
  top:0;
  left;0;
  div {
    position: absolute;
    width: 500px;
    height: 700px;
    border: 1px red solid;
    top: 50%;
